schema: 1
organizationId: 00000000-0000-0000-0000-000000000000
packs:
  - schema: 3
    name: "@taskless/oss"
    version: 1.0.0
    description: Taskless core Telemetry. The core telemetry contains common
      monitoring and logging found in APM-like solutions, and is a solid
      baseline for any observability stack.
    capture:
      durationMs:
        type: number
        description: The duration of the request in milliseconds
      status:
        type: number
        description: The status code of the request
      domain:
        type: string
        description: The domain of the request
      url:
        type: string
        description: The full URL of the request
      path:
        type: string
        description: The path of the request in the form of '/path/to/resource'
      error:
        type: string
        description: The error message
    permissions:
      domains:
        - .+
      response:
        - body
        - headers
modules:
  "@taskless/oss @ 1.0.0": 
